import { Container, Row } from "react-bootstrap";
import { ArrowRightCircle } from "react-bootstrap-icons";
import headerImg from "../assets/img/header-img.png";

export const Banner = () => {
  return (
    <section className="banner" id="home">
      <Container>
        <row className="align-items-center">
          <col xs={12} md={6} xl={7}>
            <span className="tagline">Bem vindo ao meu Portifolio</span>
            <h1>
              {`Olá eu sou uma Desenvolvedora Web`}
              <span className="wrap">Front-end Developer</span>
            </h1>
            <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has be</p>
            <button onClick={() => console.log('connect')}>Se conecte comigo!<ArrowRightCircle size={25}></ArrowRightCircle></button>
          </col>
          <col xs={12} md={6} xl={7}>
            <img src={headerImg} alt="Imagem do Header"></img>
          </col>
        </row>
      </Container>
    </section>
  );
};
